    on hand has been manually updated to reflect the new balance.  There was a difference
    of $3000 which is explained by adding a check for Missourians for Kit Bond to
    the system.  Chuck Bremer's 3/1509/ $10 Contribution was not downloaded to Vocus.
    \ I added manually and updated the cash on hand balance.  I will re-file all subsequent
    montly reports to reflect the change.  6/19/10- The reported election was coded
    incorrectly in Vocus.  Some of the candidates had contributions that were reported
    as General and should have been primary.  I have adjusted that election and have
    filed an amended report.  Some election periods were improperly named and may
    not have been reported correctly.  I have decided to verfy/adjust and update all
    reports from Feb 2007-May 2011 to make sure it goes into the correct reporting
    period.\n"
